    true,nt"url": null,nt"notes": "This data set is provided by <a href="http://boise.greenbike.com/"
    target="_blank">Boise GreenBike</a>,u00a0a bikeshare program in downtown Boise
    managed byu00a0<a href="http://valleyregionaltransit.org/" target="_blank">Valley
    Regional Transit</a>.u00a0The data includes anonymized ride information for all
    Boise GreenBike trips from April 15, 2015, when the service launched to December
    31, 2015. We removed all administrative trips and trips shorter than 1 minute, as
    many of these are false starts.<div><br /></div><div>You can join this data with
    station information via theu00a0<a href="http://boise.greenbike.com/opendata"
    target="_blank">Boise GreenBike System/Station API Feed</a>u00a0(GBFS).rnrnThis
    data is hosted by the City of Boise for informational purposes; data is managed
    by Boise GreenBike. Boise GreenBike plans to launch its own data portal in 2016
    and we will link to their portal for future trip data.</div>",nt"license_title":
